import React from "react";
import "./Project.css"; // Ensure this path is correct

const App = () => {
  const cardsData = [
    { id: 1, title: "Card 1", description: "This is Card 1 description.", imageUrl: "https://via.placeholder.com/150" },
    { id: 2, title: "Card 2", description: "This is Card 2 description.", imageUrl: "https://via.placeholder.com/150" },
    { id: 3, title: "Card 3", description: "This is Card 3 description.", imageUrl: "https://via.placeholder.com/150" },
    { id: 4, title: "Card 4", description: "This is Card 4 description.", imageUrl: "https://via.placeholder.com/150" },
  ];

  console.log("Rendering App, cardsData:", cardsData);

  return (
    <div className="cardContainer">
      {cardsData.map((card) => {
        console.log("Rendering card:", card);
        return (
          <div key={card.id} className="card">
            <img src={card.imageUrl} alt={card.title} className="cardImage" />
            <h2 className="cardTitle">{card.title}</h2>
            <p className="cardDescription">{card.description}</p>
          </div>
        );
      })}
    </div>
  );
};

export default App;
